import React from 'react'

const FAQ = ({faq, index, toggleFAQ}) => {

    return (
        <div 
        className={"faq " + (faq.open ? 'open' : '')}
        key={index}
        onClick={() => toggleFAQ(index)}
        >
            <div className="faq-question">
                {faq.question}
            </div>
            <div className="faq-answer">
                <li>{faq.answer[0]}</li> <br></br>
                <li>{faq.answer[1]}</li>
                <li>{faq.answer[2]}</li>
            </div>

            <div>
                {faq.ask}
            </div>
        </div>
    )
}

export default FAQ
